(()=>{var r={};r.post=async function(e="",t={}){return(await fetch(e,{method:"POST",mode:"same-origin",cache:"no-cache",credentials:"same-origin",headers:{"Content-Type":"application/json"},redirect:"follow",referrerPolicy:"no-referrer",body:JSON.stringify(t)})).json()};r.get=async function(e=""){return(await fetch(e,{method:"GET",mode:"same-origin",cache:"no-cache",credentials:"same-origin",headers:{"Content-Type":"application/json"},redirect:"follow",referrerPolicy:"no-referrer"})).json()};r.init_get=function(n){let e=n.dataset.nbGet;if(e){var t=JSON.parse(e);t.url&&r.get(t.url).then(i=>{r.handle_get(n,i)})}};r.handle_get=function(n,e){var t=nb_populate(n.innerHTML,e);n.nodeName==="TEMPLATE"&&n.replaceWith(t)};r.init=function(){document.querySelectorAll("[data-nb-get]").forEach(e=>{r.init_get(e)})};function o(){r.init()}window.nb_populate=function(n,e){let t=n;for(v in e){let i=new RegExp("\\(\\("+v+"\\)\\)","g");t=t.replace(i,e[v])}return t};o();})();
